import math

def process_queries(n, x, queries):
    MAX = max(x) - 1
    freq = [0] * MAX
    for i in x:
        freq[i] += 1
    sieve = [False] * MAX
    f = [0] * MAX
    for i in range(2, MAX):
        if sieve[i]:
            continue
        for j in range(i, MAX, i):
            sieve[j] = True
            f[i] += freq[j]
    for i in range(2, MAX):
        f[i] += f[i - 1]
    results = []
    for (l, r) in queries:
        if l >= MAX:
            results.append(0)
        elif r >= MAX:
            results.append(f[-1] - f[l - 1])
        else:
            results.append(f[r] - f[l - 1])
    return results

